import React from 'react';

function Login() {
  return (
    <div>
      <h2>Prijava</h2>
      <form>
        <input type="text" placeholder="Korisničko ime" /><br />
        <input type="password" placeholder="Lozinka" /><br />
        <button type="submit">Prijavi se</button>
      </form>
    </div>
  );
}

export default Login;
